	return (
		<NavIsOpenedProvider>
			<PostsRefreshProvider>
				<div className="h-screen flex justify-center max-w-7xl">
					<PostsPageContainer />
				</div>
			</PostsRefreshProvider>
		</NavIsOpenedProvider>
	);
};

export default PostsPage;
